import React, { useState } from "react";
import { Modal, Form, Input, InputNumber } from "antd";
import CustomizedForm from "./customizedForm";

const CustomModal = ({
  visible,
  onCancel,
  editFirstData,
  editSecondData,
  editThirdData,
  editFourthData,
  data
}) => {
  const [fields, setFields] = useState({});
  console.log(fields);
  const newdata = () => {
    const newestData = { ...data };
    console.log(newestData);
    setFields(newestData);
  };
  return (
    <Modal
      // onOk={}
      centered
      closable={false}
      visible={visible}
      onCancel={onCancel}
    >
      <CustomizedForm
        fields={fields}
        onChange={newFields => {
          setFields(newFields);
        }}
      />
      <pre className="language-bash">{JSON.stringify(fields, null, 2)}</pre>
    </Modal>
  );
};

export default CustomModal;

